		copyBtn.onclick = function() {

			var input = document.createElement('input');
			// input
			input.value = allcode
			// inputbody
			document.body.appendChild(input);
			// input
			input.select();

			// 
			try {
				document.execCommand('copy');
			} catch (e) {
				console.log('');
			}
			alert("");
			// input
			document.body.removeChild(input);

		}

		var allcode = ''
		var displayBtnElt = document.getElementById("exportbtn");
		displayBtnElt.onclick = function() {
			// console.log(json);
			var rpsKeyNum3 = parseInt(document.getElementById('rps3-key-num').value);
			var rpsKeyNum3max = parseInt(document.getElementById('rps3-key-max').value);
			var rpsKeyNum5 = parseInt(document.getElementById('rps5-key-num').value);
			var rpsKeyNum10 = parseInt(document.getElementById('rps10-key-num').value);
			var rpsKeyNum20 = parseInt(document.getElementById('rps20-key-num').value);
			var top120Num = parseFloat(document.getElementById('key-top120-num').value);
			var top250Num = parseFloat(document.getElementById('key-top250-num').value);
			var shizhi = parseInt(document.getElementById('key-40yi-num').value);

			var rKeyhs = parseInt(document.getElementById('hs-key-num').value);
			var rKeyhsmax = parseInt(document.getElementById('hs-key-max').value);

			var emps = json;
			var htmlStr = "";
			var num = 0;

			allcode = ''
			for (var i = 0; i < emps.length; i++) {
				var emp = emps[i];
				if (emp.rps3 < rpsKeyNum3 || emp.rps3 > rpsKeyNum3max) {
					continue
				}
				if (emp.rps5 < rpsKeyNum5) {
					continue
				}
				if (emp.rps10 < rpsKeyNum10) {
					continue
				}
				if (emp.rps20 < rpsKeyNum20) {
					continue
				}
				if (emp.topHigh120 < top120Num) {
					continue
				}
				if (emp.topHigh250 < top250Num) {
					continue
				}
				if (emp.circ_mv < shizhi) {
					continue
				}
				if (emp.huanshou < rKeyhs || emp.huanshou > rKeyhsmax) {
					continue
				}
				num = num + 1
				allcode += emp.symbol + ',' //
				htmlStr += "<tr>";
				td1 =
					'<td colspan="1" rowspan="1" id="list-line" align="center">'
				htmlStr += td1 + (num) + '</td>'; //
				htmlStr += td1 + '<a href="https://gushitong.baidu.com/stock/ab-' + emp.symbol + '">' + emp
					.symbol + '</a>' + '</td>'; // 
				htmlStr += td1 + emp.name + "</td>"; //
				htmlStr += td1 + emp.hy + "</td>";
				htmlStr += td1 + emp.hy2 + "</td>";
				htmlStr += td1 + emp.rps3 + "</td>";
				htmlStr += td1 + emp.rps5 + "</td>";
				htmlStr += td1 + emp.rps10 + "</td>";
				htmlStr += td1 + emp.rps20 + "</td>";
				htmlStr += td1 + emp.huanshou + "</td>";
				htmlStr += td1 + emp.circ_mv + "</td>";
				htmlStr += td1 + emp.topHigh60 + "</td>";
				htmlStr += td1 + emp.topHigh120 + "</td>";
				htmlStr += td1 + emp.topHigh250 + "</td>";
				htmlStr += td1 + emp.vol_rr + "</td>";
				htmlStr += td1 + emp.koudai + "</td>";
				htmlStr += "</tr>";
			}
			//tbody
			document.getElementById("tBody").innerHTML = htmlStr;
			//span
			document.getElementById("count").innerText = num;
		}
	};
